function Contact() {
  return (
    <section id="contact" className="py-20 px-6 max-w-5xl mx-auto bg-blue-50 rounded-lg">
      <h2 className="text-3xl font-bold mb-6">Contact</h2>
      <p className="mb-4">You can reach me at:</p>
      <p>Email: <a href="mailto:pavithrangnanasekaran@gmail.com" className="text-blue-600">pavithrangnanasekaran@gmail.com</a></p>
      <p>Phone: (716)-948-6114</p>
      <p>LinkedIn: <a href="https://www.linkedin.com/in/pavithran-gnanasekaran-6a84622a2/" className="text-blue-600">Pavithran</a></p>
      <p>GitHub: <a href="https://github.com/PAVITHRAN2003" className="text-blue-600">Pavithran</a></p>
    </section>
  );
}

export default Contact;
